import SearchMembers from "../components/SearchMembers";
import Grid from "../components/Grid";
import users from "../components/Users";

export default function Members() {
  return (
    <div>
      <div className="mt-32">
        <SearchMembers />
      </div>
      <div>
        <Grid item={users} />
      </div>
    </div>
  );
}
